import * as React from "react";
import './startPage.css';

const {useState} = React;
export default function App () {
const[counter, setCounter] = useState(0);
  return (
    <div className="page">
    <div className="container">
       <div className="child">
   <p>{counter}</p>
   </div>
   <button onClick={()=>{
     setCounter(counter+1);
   }

   }>spausk</button> 
   </div>

   </div>
  );
}
